// Updated AdminDashboard.js with weekly charts
import React, { useState, useEffect } from 'react';
import AdminEmployees from './AdminEmployees';
import AdminParking from './AdminParking';
import AdminVehicles from './AdminVehicles';
import AdminEntries from './AdminEntries';
import AdminExits from './AdminExits';
import AdminPayments from './AdminPayments';
import { useNavigate } from 'react-router-dom';
import './AdminDashboard.css';
import {
  LineChart,
  Line,
  CartesianGrid,
  XAxis,
  YAxis,
  Tooltip,
  ResponsiveContainer,
} from 'recharts';

function AdminDashboard() {
  const [activePage, setActivePage] = useState('raporlar');
  const [sidebarOpen, setSidebarOpen] = useState(true);
  const [dolulukChartData, setDolulukChartData] = useState([]);
  const [kazancChartData, setKazancChartData] = useState([]);
  const [parkedVehicles, setParkedVehicles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const storedUser = JSON.parse(localStorage.getItem('user'));
    if (!storedUser || !storedUser.id) {
      navigate('/');
      return;
    }
    setUser(storedUser);
  }, [navigate]);

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);

  useEffect(() => {
    if (activePage === 'raporlar') {
      const fetchReports = async () => {
        try {
          const [dolulukRes, kazancRes, parkedRes] = await Promise.all([
            fetch('/api/report/doluluk-haftalik'),
            fetch('/api/report/kazanc-haftalik'),
            fetch('/api/parkedVehicles'),
          ]);

          const dolulukJson = await dolulukRes.json();
          const kazancJson = await kazancRes.json();
          setDolulukChartData(dolulukJson);
          setKazancChartData(kazancJson);
          setParkedVehicles(await parkedRes.json());
          setLoading(false);
        } catch (err) {
          console.error('Veriler alınırken hata:', err);
          setError('Veriler alınamadı.');
          setLoading(false);
        }
      };
      fetchReports();
    }
  }, [activePage]);

  return (
    <div className="admin-dashboard-container">
      <header className="admin-dashboard-header">
        <h1>Admin Paneli</h1>
        <div className="admin-dashboard-user">{user?.name || 'Admin'}</div>
      </header>

      <div className="admin-dashboard-body">
        <aside className={`admin-sidebar ${sidebarOpen ? 'open' : 'closed'}`}>
          <button className="toggle-btn" onClick={toggleSidebar}>
            {sidebarOpen ? '<' : '>'}
          </button>
          {sidebarOpen && (
            <nav className="sidebar-nav">
              {['raporlar', 'calisanlar', 'otopark', 'araclar', 'girisler', 'cikislar', 'odemeler'].map((page) => (
                <li key={page} className={activePage === page ? 'active' : ''}>
                  <button onClick={() => setActivePage(page)}>
                    {page.charAt(0).toUpperCase() + page.slice(1)}
                  </button>
                </li>
              ))}
            </nav>
          )}
        </aside>

        <main className="admin-main">
          {activePage === 'raporlar' ? (
            <div className="admin-report-page">
              {loading ? (
                <p>Yükleniyor...</p>
              ) : error ? (
                <p className="error">{error}</p>
              ) : (
                <>
                  <div className="chart-section">
                    <div className="chart-box">
                      <h3>Otopark Doluluk Oranı</h3>
                      <ResponsiveContainer width="100%" height={250}>
                        <LineChart data={dolulukChartData}>
                          <Line type="monotone" dataKey="oran" stroke="#007bff" strokeWidth={2} />
                          <CartesianGrid stroke="#ccc" />
                          <XAxis dataKey="gun" />
                          <YAxis domain={[0, 100]} tickFormatter={(val) => `${val}%`} />
                          <Tooltip formatter={(val) => `${val}%`} />
                        </LineChart>
                      </ResponsiveContainer>
                    </div>

                    <div className="chart-box">
                      <h3>Haftalık Kazanç (TL)</h3>
                      <ResponsiveContainer width="100%" height={250}>
                        <LineChart data={kazancChartData}>
                          <Line type="monotone" dataKey="kazanc" stroke="#28a745" strokeWidth={2} />
                          <CartesianGrid stroke="#ccc" />
                          <XAxis dataKey="gun" />
                          <YAxis />
                          <Tooltip formatter={(val) => `${val} TL`} />
                        </LineChart>
                      </ResponsiveContainer>
                    </div>
                  </div>

                  <section className="parked-vehicles">
                    <h3>Otoparkta Bulunan Araçlar</h3>
                    <table>
                      <thead>
                        <tr>
                          <th>Plaka</th>
                          <th>Giriş Saati</th>
                        </tr>
                      </thead>
                      <tbody>
                        {parkedVehicles.map((vehicle, i) => (
                          <tr key={i}>
                            <td>{vehicle.plaka}</td>
                            <td>{vehicle.giris_saat}</td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </section>
                </>
              )}
            </div>
          ) : activePage === 'calisanlar' ? (
            <AdminEmployees />
          ) : activePage === 'otopark' ? (
            <AdminParking />
          ) : activePage === 'araclar' ? (
            <AdminVehicles />
          ) : activePage === 'girisler' ? (
            <AdminEntries userId={user?.id} />
          ) : activePage === 'cikislar' ? (
            <AdminExits userId={user?.id} />
          ) : activePage === 'odemeler' ? (
            <AdminPayments userId={user?.id} />
          ) : (
            <div className="placeholder-page">
              <h2>{activePage}</h2>
              <p>Bu sayfa henüz hazır değil.</p>
            </div>
          )}
        </main>
      </div>
    </div>
  );
}

export default AdminDashboard;
